from random import randint
words = ""
Wlist = [words[i:i+5] for i in range(0, len(words), 5)]
word = Wlist[randint(0,5756)]
word = list(word)

complete = False

guesses = 0
while not complete:
    
    guess = input("Please input a 5 letter word: ")
    if guess not in Wlist or len(guess) != 5:
        print("This is an invalid guess, please try again.")
    if guess in Wlist:
        if guesses > 4:
            print("Oops! Game over! The word was:", ''.join(word), ". Better luck next time!")
            complete = True
        status = [0,0,0,0,0]
        guess = list(guess)
        guesses += 1
        if guess == word:
            print("You win! Congratulations! The word was:", ''.join(word))
            complete = True
        for i in range(5):
            if guess[i] == word[i]:
                status[i] = 2
                guess[i] = 0
            elif guess[i] in word:
                status[i] = 1
                guess[i] = 0
        print(status)
